import PlayersSelection from './components/PlayersSelection';
import Tap from './components/fightZone/Tap';
import Countdown from './components/Countdown';
import DisplayCountdown from './components/DisplayCountdown';

function App() {
  return (
    <div className="App">
      <Home />
      <MapButton />
      <PlayersSelection />
      <div className="buttonFight">
        <Tap />
        <Tap />
      </div>
      <Countdown />
      <DisplayCountdown />
    </div>
  );
}

export default App;
